import React, { useState } from 'react';
import { Button, Modal } from 'antd';

const AppWorks = () => {
    const [isModalVisible, setIsModalVisible] = useState(false);

    const showModal = () => {
        setIsModalVisible(true);
    };

    const handleOk = () => {
        setIsModalVisible(false);
    };

    const handleCancel = () => {
        setIsModalVisible(false);
    };

    return (
        <div className="block worksBlock">
            <div className="container-fluid">
                <div className="titleHolder">
                    <h2>Contact</h2>
                </div>
                <>
                    <Button type="primary" onClick={showModal}>
                        Open Modal
                    </Button>
                    <Modal title="Basic Modal" visible={isModalVisible} onOk={handleOk} onCancel={handleCancel} cancelText="Close" closable={false}>
                        <iframe title='video' width="100%" height="500" src='https://www.youtube.com/embed/DxNu1tVksqM'></iframe>
                    </Modal>
                </>
            </div>
        </div>
    );
};

export default AppWorks;
